import React from 'react';
import { Table } from 'semantic-ui-react';

class TableForPrint extends React.Component {

	render() {

		const cells = this.props.data.map((item, index) => {
			if (item.number !== "35834439430" && item.number !== "034541541" && item.number !== "35834541541") {
				return (
					<Table.Row key={index}>
						<Table.Cell textAlign='center' style={{ width: '10%', border: '1px solid #ccc', borderRightColor: 'transparent' }}>{item.info}</Table.Cell>
						<Table.Cell textAlign='center' style={{ width: '30%', border: '1px solid #ccc', borderRightColor: 'transparent' }}>{item.number}</Table.Cell>
						<Table.Cell textAlign='center' style={{ width: '20%', border: '1px solid #ccc', borderRightColor: 'transparent' }}>{item.short_number}</Table.Cell>
					</Table.Row>
				);
			}
			else return null;
		});
		//celled
		//collapsing
		return (
			<div style={{ marginLeft: '20%', marginRight: '20%' }}>
				<Table id="printTable" celled structured>
					<Table.Header>
						<Table.Row>
							<Table.HeaderCell textAlign='center' style={{ border: '1px solid #ccc' }} colSpan='2'>Name</Table.HeaderCell>
							<Table.HeaderCell textAlign='center' style={{ border: '1px solid #ccc' }} colSpan='2'>Public Number</Table.HeaderCell>
							<Table.HeaderCell textAlign='center' style={{ border: '1px solid #ccc' }} colSpan='2'>Short Number</Table.HeaderCell>
						</Table.Row>
					</Table.Header>
					<Table.Body>
						{cells}
						<Table.Row>
							<Table.Cell textAlign='center' style={{ width: '10%', border: '1px solid #ccc' }} colSpan='2'>Call Conference</Table.Cell>
							<Table.Cell textAlign='center' style={{ width: '30%', border: '1px solid #ccc' }}>034541541</Table.Cell>
							<Table.Cell textAlign='center' style={{ width: '10%', border: '1px solid #ccc' }}><button style={{display: 'none'}} className="ui icon button"><i aria-hidden="true" className="trash alternate icon"></i></button></Table.Cell>
							<Table.Cell textAlign='center' style={{ width: '20%', border: '1px solid #ccc' }}>99</Table.Cell>
							<Table.Cell textAlign='center' style={{ width: '10%', border: '1px solid #ccc' }}><button style={{display: 'none'}} className="ui icon button"><i aria-hidden="true" className="trash alternate icon"></i></button></Table.Cell>
						</Table.Row>
					</Table.Body>
				</Table>
			</div>
		);
	}
};

export default TableForPrint;
